import '../CSS/CountryForm.css';
import {useState} from 'react';

function CountryForm({setShowCountryForm}){

	const [formData, setFormData] = useState({country_name:'', country_quota:'', country_season:''});

	async function onSubmit(e){
		e.preventDefault();
	}

	return(

	<section className="Country-Form">
		<button className='New-Season-Button-Active' >
			<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24">
				<path d="M24 9h-9v-9h-6v9h-9v6h9v9h6v-9h9z"/>
			</svg>
		</button>
		<button className='New-ROI-Button' onClick={()=>setShowCountryForm(false)}>
			<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24">
				<path d="M14.078 4.232l-12.64 12.639-1.438 7.129 7.127-1.438 12.641-12.64-5.69-5.69zm-10.369 14.893l-.85-.85 11.141-11.125.849.849-11.14 11.126zm2.008 2.008l-.85-.85 11.141-11.125.85.85-11.141 11.125zm18.283-15.444l-2.816 2.818-5.691-5.691 2.816-2.816 5.691 5.689z"/>
			</svg>
		</button>
		<h1 className='New-Season-Title'>New Season Quotas</h1>
		<form className='New-Season-Form'>
			<div>
  				<input type="text" id="Country" placeholder='Country'/>
			</div>
			<div>

  				<input type="text" id="Quota" placeholder='Quota'/>
			  </div>
			<div>

  				<input type="text" id="Season" placeholder='Season'/>
			</div>
			<div>
				<input type="submit" className='Submit-Button' onClick={(e)=>onSubmit(e)}/>
			</div>




		</form>

	</section>
	);

}
export default CountryForm;
